import React, { useState } from 'react';
import LargeButton from '../components/LargeButton';
import { Link } from 'react-router-dom';

const Home = () => {

    return (
        <div className='absolute top-1/3 object-center flex flex-row gap-x-10 mx-10'>
            <Link to={'/skills'} style={{ textDecoration: 'none', display: 'inline-block' }}>
                <LargeButton colour='blue'
                label="Skills & Education" desc="Coding languages, technologies, and educational accomplishments"
                />
            </Link>
            <Link to={'/skills'}>
                <LargeButton colour='yellow'
                label="Projects & Experience" desc="Exhibit of personal projects work work experiences"
                />
            </Link>
        </div>
    );
};

export default Home;
